import React from "react";
import "./C.css";
import {Link} from "react-router-dom";
import Service from "../service/Service";

class Html extends React.Component{
    constructor(props){
        super(props)
        this.state={
            htmls:[]
        }
    }
    componentDidMount(){
        Service.getHtml().then((response) => {
            this.setState({htmls:response.data})

        });
    }
    render(){
        return(
            <div>            
                <div className="feed-item">
                    <h2 class="text-center">Html Tutorials</h2>
                    <table className="table table-striped">
                        <thead>
                            <tr className="feed-item">
                                {/* <td>Html id</td>
                                <td>Name</td>
                                <td>Text</td>
                                <td>Image</td> */}
                            </tr>
                        </thead>
                        <tbody>
                             {
                               this.state.htmls.map(
                                   html =>
                                    <tr key ={html.id}>
                                        {/* <td>{html.id}</td> */}
                                        <td>{html.name}</td>
                                        {/* <td>{html.text}</td>
                                        <td>{html.image}</td>  */}
                                    </tr>
                                )
                             }
                        </tbody>
                    </table>
                </div>
                <div className="content-item">
                    <h1>Content of Feed item</h1>
                </div>
            </div>
        )
    }
}
export default Html;
